// SPDX-License-Identifier: MIT 
pragma solidity ^0.8.10;

import "./Auction.sol";

contract AuctionFactory {
    Auction[] public auctions;

    event AuctionCreated(Auction auctionContract, address owner, uint numAuctions, Auction[] allAuctions);

    constructor() {
    }

    function createAuction(uint bidIncrement, uint startBlock, uint endBlock, string memory ipfsHash) public {
        Auction newAuction = new Auction(msg.sender, bidIncrement, startBlock, endBlock, ipfsHash);
        auctions.push(newAuction);

        emit AuctionCreated(newAuction, msg.sender, auctions.length, auctions);
    }

    function allAuctions() public view returns (Auction[] memory) {
        return auctions;
    }
}
